function PopupWithConfirm(props) {

  const handleConfirmCardDelete = (event) => {
    event.preventDefault();

  }

  const popupOpened = props.isOpen ? 'popup_opened' : '';

  return (
    <div className={`popup popup_role_${props.name} ${popupOpened}`}>
      <div className="popup__container">
        <h2 className="popup__heading">{props.title}</h2>
        <form className="form" name={props.name}>
          <button className="form__submit button" type="submit" aria-label={props.buttonText} onClick={handleConfirmCardDelete}>{props.buttonText}</button>
        </form>
      </div>
      <button className="button popup__button-close" type="button" aria-label="Закрыть" onClick={props.onClose}></button>
    </div>
  );
}

export default PopupWithConfirm;
